import { NavLink, useHistory } from "react-router-dom";
import "../Css-files/home.css"
export default function Header({ loggedIn, admin, logout }) {
  const history = useHistory();

  function onClick(e) {
    e.preventDefault();
    logout();
    history.push("/");
  }


  const the_button = document.querySelector(".js-btn")
  const modal = document.querySelector(".modal")
  const closeBtn = document.querySelector(".close")

  document.addEventListener("DOMContentLoaded",() => {
    the_button.addEventListener("click", handleClick)
  })

  function handleClick(event) {
    modal.style.display = "block";
    closeBtn.addEventListener("click", () => {
      modal.style.display = "none"
    })
  }



  return (

    <ul className="header">
      {!admin ? (
        <li>
          <NavLink activeClassName="active" to="/home">
            <div className="logo"> 
            TRAVELEAT
            </div>
          </NavLink>
        </li>
      ) : (
        ""
      )}
       {!admin && !loggedIn ? (
        <li>

          <div class="app">

      <div class="btn">
        <button class="js-btn">new user?</button>
      </div>

      <div class="modal">
       <div class="modal_content">
        <span class="close">&times;</span>
        <p>I'm A Pop Up!!!</p>
       </div>
      </div>

    </div>

        </li>
      ) : (
        ""
      )}
      {!admin && !loggedIn ? (
        <li>
          <NavLink activeClassName="active" to="/login">
            Log in
          </NavLink>
      </li>
      ) : (
        ""
      )}

      {loggedIn && !admin ? (
        <li>
          <NavLink activeClassName="active" to="/account">
            Account
          </NavLink>
        </li>
      ) : (
        ""
      )}

      {admin ? (
        <li>
          <NavLink activeClassName="active" to="/orders">
            Orders
          </NavLink>
        </li>
      ) : (
        ""
      )}
      {admin ? (
        <li>
          <NavLink activeClassName="active" to="/users">
            Users
          </NavLink>
        </li>
      ) : (
        ""
      )}
      {admin ? (
        <li>
          <NavLink activeClassName="active" to="/statistics">
            Statisticks
          </NavLink>
        </li>
      ) : (
        ""
      )}


      {admin || loggedIn ? (
        <li>
          <button className="active" onClick={onClick}>
            Log out
          </button>
        </li>
      ) : (
        ""
      )}
    </ul>
  );
}
